  `tax_id` int(11) DEFAULT NULL,
  `genus` varchar(255) DEFAULT NULL,
  `species` varchar(255) DEFAULT NULL,
  `strain` varchar(255) DEFAULT NULL,
  `genome_name` varchar(255) DEFAULT NULL,
  `zoonotic` tinyint(1) DEFAULT NULL COMMENT 'entries can be 1 (yes) or 0 (no)',
  `emerging` tinyint(1) DEFAULT NULL COMMENT 'entries can be 1 (yes) or 0 (no)',
  `category_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `category_id_idx` (`category_id`),
  CONSTRAINT `category_id` FOREIGN KEY (`category_id`) REFERENCES `category` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2311 DEFAULT CHARSET=latin1;
